"use strict";

const f_gold = (x, y) => {
    const q = [[0, 0]];
    let ans = 0;
    const vis = new Set(["0,0"]);
    const dirs = [[-2, 1], [-1, 2], [1, 2], [2, 1], [2, -1], [1, -2], [-1, -2], [-2, -1]];
    while (q.length) {
        for (let i = q.length; i > 0; i--) {
            const [a, b] = q.shift();
            if (a === x && b === y) {
                return ans;
            }
            for (const [c, d] of dirs) {
                const i2 = a + c;
                const j2 = b + d;
                const key = `${i2},${j2}`;
                if (!vis.has(key)) {
                    vis.add(key);
                    q.push([i2, j2]);
                }
            }
        }
        ans++;
    }
    return -1;
};
